#include<iostream>
#include<string>
using namespace std ; 

int main()
{
    string testStr = "";
    int count = 0 ;

    for(char ch:testStr){
        if ( ch == 'a' || ch == 'e' || ch == 'i' || ch == 'o' || ch == 'u' ){
            count++ ;
        }
    }
    cout << count << endl ;

    
    return 0 ; 
}